import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import CameraIcon from '@material-ui/icons/PhotoCamera';
import track1 from "../../music/track1.mp3"
import track2 from "../../music/track2.mp3"
import track3 from "../../music/track3.mp3"
import track4 from "../../music/track4.mp3"
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import "react-jinke-music-player/assets/index.css"
import Record from "../../components/record"
import "./sample.css"


function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles(theme => ({
  icon: {
    marginRight: theme.spacing(2),
  },
  heroContent: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(8, 0, 6),
  },
  heroButtons: {
    marginTop: theme.spacing(4),
  },
  cardGrid: {
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
  },
  card: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  cardMedia: {
    paddingTop: '56.25%', // 16:9
  },
  cardContent: {
    flexGrow: 1,
  },
  footer: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(6),
  },
}));

var curr_track = track1;
export default function Album() {
  const classes = useStyles();

  return (
    <React.Fragment>
      <main>
        {/* Hero unit */}
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
              Your Playlist
            </Typography>
            <Typography variant="h5" align="center" color="textSecondary" paragraph>
                Here is some tracks for you to enjoy. Don't like what you hear? Don't worry, you can add your own taste
                of music.
            </Typography>
            <div className={classes.heroButtons}>
              <Grid container spacing={2} justify="center">
                <Grid item>
                  <Button variant="outlined" color="secondary">
                    Add your own music
                  </Button>
                </Grid>
                <Grid item>
                  <Button variant="outlined" color="primary">
                    Link your spotify
                  </Button>
                </Grid>
              </Grid>
            </div>
          </Container>
        </div>
        <div className="record">
            <Record name="Method man - Wu tang clan"/>
            <Record name="Windwaker - Legend of Zelda"/>
            <Record name="Blue night - midnight moon"/>
        </div>

        <div className="main_player"></div>

      </main>
    </React.Fragment>
  );
}
